import React from 'react';
import Paper from "@material-ui/core/Paper";


function Question({getquestionid, id,question}) {

   const q = id => getquestionid(question.id);
    console.log(q);

    return(
        <Paper>
            <h1>Question Details</h1>
            <p>{q.title}</p>
        </Paper>
    )
}

export default Question;
